import styled from 'styled-components'
import _Globe from 'react-globe.gl'
import ThemeProvider from './theme/ThemeProvider'
import GlobalStyle from './theme/GlobalStyle'
import MapData from '../venues-slugs.json'

const MainContent = styled.div`
  margin: 10vh 0;
`

const Globe = () => {
  return <_Globe globeImageUrl="//unpkg.com/three-globe/example/img/earth-night.jpg" />
}
const App = () => {
  return (
    <ThemeProvider>
      <GlobalStyle />
      <Globe />,
    </ThemeProvider>
  )
}

export default App
